import React from 'react'
// import ArrowIcon from '../common/ArrowIcon'
import Jeans from '../../assets/images/jeans.jpg'

const Card = () => {
  return (
    <div className='flex  flex-col p-8'>
      <img src={Jeans} className='max-h[260px] max-w-[240px] bg-cover bg-center border rounded'></img>
      <p className='text-[16px] p-[5px]'>Jeans</p>
    </div>
  )
}

export default Card
